import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";


const Cart = () => {
  const {cart} = useSelector((state) => state)
  return (
  <div>
   {
    cart.length > 0 ? 
    (<div>
     {
      cart.map((item, index) => {
        return <Cartitem  key={item.id} item={item} itemIndex={index}/>
      })
     }
    </div>) : 
    (<div>
      <h1>Card Empty</h1>
      <NavLink to="/">
      <button>
         Shop Now
      </button>
      </NavLink>
    </div>)
   }
  </div>
  );
};

export default Cart;
